import React from 'react';
import { useDispatch, useSelector } from 'react-redux';

import AppLayout from '../components/AppLayout';
import ProductCard from '../components/ProductCard';

const Home = () => {
  const dispatch = useDispatch();
  const { mainProducts, loadProductsLoading } = useSelector((state) => state.Product);
  return (
    <AppLayout>
      {mainProducts.map((product) => <ProductCard key={product.id} post={product} />)}
    </AppLayout>
  );
};

export default Home;
